import React from "react";
import RocketCard from "../Card/RocketCard";

const CatalogPage = ({ rockets }) => {
  if (rockets.length === 0) {
    return <p>Loading...</p>; // Показуємо Loading, якщо ракет немає
  }

  return (
    <div className="catalog-page">
      <h1>Rocket Catalog</h1>
      <div className="rocket-list">
        {rockets.map((rocket) => (
          <RocketCard
            key={rocket.id}
            rocket={rocket}
            onPrevious={() => {}}
            onNext={() => {}}
          />
        ))}
      </div>
    </div>
  );
};

export default CatalogPage;
